  false,\n\t\"url\": null,\n\t\"notes\": \"The 2013 Fire Causes & Incident data was
  provided by the U.S. Fire Administrationu2019s (USFA) National Fire Data Centeru2019s
  (NFDCu2019s) National Fire Incident Reporting System. The National Fire Incident
  Reporting System (NFIRS) is a reporting standard that fire departments use to uniformly
  report on the full range of their activities, from fire to emergency medical services
  (EMS) to equipment involved in the response. NFIRS is the worldu2019s largest, national,
  annual database of fire incident information, and comprises about 75 percent of
  all reported fires that occur annually. NFIRS is a voluntary tool\",\n\t\"license_title\":
